import React from "react";
import classes from './cardBody.module.css'
import {CardBody, Col, Label, Row} from "reactstrap";
import FormatListNumberedIcon from '@material-ui/icons/FormatListNumbered';
import Translate from "../../../../Translate";
import InputUi from "../../../../components/inputUI/inputUI";

const BodyComponent = props => {

    const formDataRender = data => {
        for (let item in data.departOne) {
            console.log(item)
        }
    }

    return (
        <CardBody>
            <h4 className='pb-2'>
                <FormatListNumberedIcon fontSize={'large'}/>
                <Translate name={'It is necessary to indicate the numbers of the sections in the corresponding field'}/>
            </h4>
            <Row>
                <Col md={6} className={classes.colWindow}>
                    <div>
                        {
                            formDataRender(props.formData)
                        }
                        <InputUi
                            margin={'0 0 20px'}
                            label={'sku'}
                            type={'number'}
                            name={'sku'}
                        />
                        <InputUi
                            margin={'0 0 20px'}
                            label={'name'}
                            type={'number'}
                            name={'name'}
                        />
                        <InputUi
                            margin={'0 0 20px'}
                            label={'points'}
                            type={'number'}
                            name={'points'}
                        />
                        <InputUi
                            margin={'0 0 20px'}
                            label={'measurement'}
                            type={'number'}
                            name={'measurement'}
                        />
                    </div>
                </Col>
                <Col md={6} className={classes.colWindow}>
                    <div>
                        <InputUi
                            margin={'0 0 20px'}
                            label={'classifiers'}
                            type={'number'}
                            name={'classifiers'}
                        />
                        <InputUi
                            margin={'0 0 20px'}
                            label={'suppliers'}
                            type={'number'}
                            name={'suppliers'}
                        />
                        <InputUi
                            margin={'0 0 20px'}
                            label={'barcode'}
                            type={'number'}
                            name={'barcode'}
                        />
                        <InputUi
                            margin={'0 0 20px'}
                            label={'description'}
                            type={'number'}
                            name={'description'}
                        />
                    </div>
                </Col>
            </Row>
        </CardBody>
    )
}

export default BodyComponent
